import React from "react";
import './bodyAboutMe.css';


class bodyAboutMe extends React.Component {
    render() {
        return (
            <div className={this.props.className}>
            <h1>About Me</h1>
            <p>I am a Full Stack Developer with a background in Marketing and Sales. I have extensive experience in Front End Development, Back End Development, Mobile Development, Data Analysis, Data Visualization, and Data Science</p>
            </div>
        )


    }

}
 export default bodyAboutMe;
